CREATE TABLE HospitalAddresses(
   HospitalAddressId INTEGER  NOT NULL PRIMARY KEY 
  ,Provider_ID       INTEGER  NOT NULL
  ,Address           VARCHAR(50)
  ,City              VARCHAR(20)
  ,State             VARCHAR(2)
  ,ZIP_Code          INTEGER 
  ,County_Name       VARCHAR(20)
  ,Foreign Key(Provider_ID) references HospitalDetails(Provider_Id)
);
